{
  "message_name": "UBX-CFG-CFG",
  "message_class": "0x06",
  "message_id": "0x09",
  "message_type": "command",
  "payload_length": {
    "fixed": 13
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "X4",
      "name": "clearMask",
      "description": "Mask for configuration to clear. If any bit is set, all saved configuration from the selected non-volatile memory is deleted."
    },
    {
      "byte_offset": 4,
      "data_type": "X4",
      "name": "saveMask",
      "description": "Mask for configuration to save. If any bit is set, all current configuration is stored (copied) to the selected layers."
    },
    {
      "byte_offset": 8,
      "data_type": "X4",
      "name": "loadMask",
      "description": "Mask for configuration to load. If any bit is set, the current configuration is discarded and rebuilt from all the lower layers."
    },
    {
      "byte_offset": 12,
      "data_type": "X1",
      "name": "deviceMask",
      "description": "Mask which selects the memory devices for saving and/or clearing operation. This is an optional field. If not provided, the receiver defaults the operation requested to battery-backed RAM (BBR) and Flash (if available).",
      "bit_fields": [
        {
          "bit_offset": 0,
          "bit_length": 1,
          "name": "devBBR",
          "description": "Battery-backed RAM"
        },
        {
          "bit_offset": 1,
          "bit_length": 1,
          "name": "devFlash",
          "description": "Flash"
        },
        {
          "bit_offset": 2,
          "bit_length": 1,
          "name": "devEEPROM",
          "description": "EEPROM (only supported for protocol versions less than 14.00)"
        },
        {
          "bit_offset": 4,
          "bit_length": 1,
          "name": "devSpiFlash",
          "description": "SPI Flash (only supported for protocol versions less than 14.00)"
        }
      ]
    }
  ]
}
